const now = require("performance-now");
// Given a string s, return the longest palindromic substring in s.

//     Example 1:
//
// Input: s = "babad"
// Output: "bab"
// Note: "aba" is also a valid answer.
//     Example 2:
//
// Input: s = "cbbd"
// Output: "bb"
// Example 3:
//
// Input: s = "a"
// Output: "a"
// Example 4:
//
// Input: s = "ac"
// Output: "a"
//
//
// Constraints:
//
//     1 <= s.length <= 1000
// s consist of only digits and English letters.

const s = [
    'never odd or even',
    'racecar',
    'babad', // Output: "bab"
    'cbbd', // Output: "bb"
    'a', // Output: "a"
    'ac', // Output: "a"
    'bb', // Output: "bb"
    'ccc', // Output: "ccc"
    'abcba', // Output: "abcba"
    'aacabdkacaa', // Output: "aaca"
    '',
    '',
    ''
];
const p = [ 'bab', 'bb', 'a', 'babba',
    'aaca', 'aca'
];

/**
 * @param {string} s
 * @return {string}
 */
const longestPalindrome = function(s) {
    if(s.length === 1) return s;
    let longest = '';
    for(let i = 0; i < s.length; i++) {
        for(let j = s.length; j >= 1; j--) {
            let sub = s.substr(i,j);
            let result = isPalindrome(sub);
            if(result) {
                if(sub.length > longest.length)
                    longest = sub;
            }
        }
    }
    return longest;
};

function isPalindrome(s) {
    if(s.length === 1) return true;
    let i = 0, j = s.length - 1;
    if(s.charAt(i) !== s.charAt(j)) return false;
    while(s.charAt(i) === s.charAt(j) && j > i) {
        i++;
        j--;
    }
    return j - i < 1;
}

// p.forEach(item => console.log(item, isPalindrome(item)));
s.forEach(item => {
    const start = now();
    console.log(`${longestPalindrome(item)} - ${(now() - start).toFixed(3)} ms`);
});
